import React from 'react';

const Browse = () => {
  const containerStyle = {
    textAlign: 'center',
  };

  const headingStyle = {
    fontSize: '24px',
    fontWeight: 'bold',
    marginBottom: '20px',
  };

  const productContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
  };

  const productStyle = {
    margin: '0 10px', // Adjust the margin as needed
  };

  const imageStyle = {
    width: '200px', // Adjust the width as needed
    height: '200px', // Adjust the height as needed
    objectFit: 'cover', // Maintain aspect ratio
    borderRadius: '10px', // Optional: Add border-radius for rounded corners
  };

  const priceStyle = {
    marginTop: '10px',
    fontSize: '18px',
    fontWeight: 'bold',
    color: 'green', // Optional: Set the color for the price
  };

  return (
    <div style={containerStyle}>
      <h1 style={headingStyle}>Browse The Range</h1>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptate porro, maxime perspiciatis adipisci laboriosam mollitia id, architecto in placeat distinctio consequatur ad quas ea vero beatae, dolor at asperiores magnam.
      </p>

      <div style={productContainerStyle}>
        <div style={productStyle}>
          <img
            src="tree_image_url_1.jpg" // Replace with the actual URL of the first tree image
            alt="Tree 1"
            style={imageStyle}
          />
          <p style={priceStyle}>$50.00</p>
        </div>

        <div style={productStyle}>
          <img
            src="tree_image_url_2.jpg" // Replace with the actual URL of the second tree image
            alt="Tree 2"
            style={imageStyle}
          />
          <p style={priceStyle}>$65.00</p>
        </div>
        <div style={productStyle}>
